import { useTryOnDiffusion } from '@/libs/hooks/useTryOnDiffusion'; // Đường dẫn tới hook
import { useState } from 'react';

const Test = () => {
  const [modelImage, setModelImage] = useState<File | null>(null);
  const [clothImage, setClothImage] = useState<File | null>(null);
  const { tryOnDiffusion, result, loading, error } = useTryOnDiffusion();

  // Hàm xử lý khi submit
  const handleSubmit = () => {
    if (modelImage && clothImage) {
      tryOnDiffusion({
        modelImage,
        clothImage,
        category: 'Upper body',
        numInferenceSteps: 35,
        guidanceScale: 2,
        seed: 12467,
        base64: true,
      });
      // }
    }
  };
  return (
    <div className="flex flex-col space-y-5">
      <h1>Try-On Diffusion</h1>

      {/* Tải ảnh người mẫu */}
      <h2>Model Image</h2>
      <input
        type="file"
        accept="image/*"
        onChange={(e) =>
          setModelImage(e.target.files ? e.target.files[0] : null)
        }
      />

      {/* Tải ảnh quần áo */}
      <h2>Cloth Image</h2>
      <input
        type="file"
        accept="image/*"
        onChange={(e) =>
          setClothImage(e.target.files ? e.target.files[0] : null)
        }
      />

      <button onClick={handleSubmit} disabled={loading}>
        {loading ? 'Processing...' : 'Try On'}
      </button>

      {/* Hiển thị kết quả */}
      {/* {error && <p style={{ color: 'red' }}>{error}</p>} */}
      {result && (
        <img
          src={`data:image/png;base64,${result.image as string}`}
          alt="Result"
        />
      )}
      <img 
        src={`data:image/png;base64,${""}`}
      />
    </div>
  );
};

export default Test;
